var renderProjects = function(projects, root){
    root.text("Projects (");
    $.each(projects, function (ckey, cval) {
        $('<a/>')
            .addClass('.profile-detail')
            .attr('href', cval.href)
            .attr('target', "_blank")
            .text(cval.name)
            .appendTo(root);
        if (ckey < projects.length-1) root.append(", ");
    });
    root.append(")");
}

var renderContent = function(contents, utilized, root){
    $.each(contents, function (ckey, cval) {
        $('<p/>')
            .addClass('.profile-detail')
            .css({"line-height": "1.6", "font-size": "13px"})
            .text(" - "+cval)
            .appendTo(root);
    });

    $('<p/>')
        .addClass('.profile-detail')
        .css({"line-height": "1.6", "font-size": "13px"})
        .html(" - <b>Utilized</b>: "+utilized.join(", "))
        .appendTo(root);
}

$.each(employers, function (key, val) {
    var contentDiv =  $("#"+val.id+"Content");
    contentDiv.css("margin-top", "5px");
    renderProjects(val.projects, $("#"+val.id+"Projects"));
    renderContent(val.content, val.utilized, contentDiv);
});


var cList = $('ul#projectsUl').addClass('pv-profile-section__section-info section-info pv-profile-section__section-info--has-no-more');

$.each(personalProjects, function (key, val) {

    var first = $('<div/>').addClass('pv-entity__position-group-pager').appendTo(cList);
    var li = $('<li/>')
        .addClass('pv-profile-section__card-item-v2 pv-profile-section pv-position-entity ember-view')
        .css("padding-right", "10px")
        .appendTo(first);
    var container = $('<div/>').appendTo(li);
    var imgContainer = $('<div/>').addClass('pv-entity__logo company-logo')
        .appendTo(container);
    $('<img>').addClass('lazy-image pv-entity__logo-img pv-entity__logo-img EntityPhoto-square-5 loaded')
        .attr("src", val.icon)
        .appendTo(imgContainer);
    var contentContainer = $('<div/>').css("display","flex")
        .css("flex-direction","column")
        .addClass('pv-entity__summary-info pv-entity__summary-info--background-section mb2')
        .appendTo(container);
    var div = $('<div/>').css("display","flex").appendTo(contentContainer);
    $('<h4/>')
        .addClass('pv-accomplishment-entity__title')
        .text(val.descriptionName)
        .appendTo(div);

    if (val.link.length > 0){
        var links = $('<div/>').css("font-size", "13px").append("&nbsp;(");
        $.each(val.link, function (lkey, lval) {
            var a = $('<a/>').attr('href', lval.href).attr('target', "_blank").text(lval.name);
            if (lkey < val.link.length - 1) a.append(",&nbsp;");
            a.appendTo(links);
        });
        links.append(")&nbsp;");
        links.appendTo(div);
    }
    renderContent(val.content, val.utilized, contentContainer);
});
